import React from 'react';
import ReactDOM from 'react-dom';

export default class Canvas extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      canvasData: this.props.canvasData
    };
  }

  componentDidMount() {
    console.log('canvasData', this.state.canvasData);

    var canvas = ReactDOM.findDOMNode(this.refs.canvas),
      ctx = canvas.getContext('2d'),
      faccatImage = new Image(),
      techpartyImage = new Image(),
      signImage = new Image(),
      cWidth = canvas.width,
      cHeight = canvas.height,
      xCenter = canvas.width / 2,
      yCenter = canvas.height / 2;

    faccatImage.src = 'data:image/png;base64,';
    techpartyImage.src = 'data:image/png;base64,';
    signImage.src = 'data:image/png;base64,';

    ctx.fillStyle = 'white';
    ctx.fill();

    ctx.drawImage(faccatImage, 40, 25);
    ctx.drawImage(techpartyImage, cWidth - 180, 10);
    ctx.drawImage(signImage, xCenter - 64, cHeight - 205 );

    ctx.font = 'bold 50px sans-serif';
    ctx.textAlign = 'center';
    ctx.fillStyle = 'black';
    ctx.fillText('Certificado de participação', xCenter, 163);

    ctx.font = 'bold 20px sans-serif';
    ctx.textAlign = 'center';
    ctx.fillText('Este certificado está sendo conferido a', xCenter, 223);

    ctx.font = 'bold 40px sans-serif';
    ctx.textAlign = 'center';
    ctx.fillText('Fernando de Siqueira Porazzi', xCenter, 290);

    // username underline
    ctx.beginPath();
    ctx.moveTo(200, 300);
    ctx.lineTo(970, 300);
    ctx.stroke();

    // assinatura underline
    ctx.beginPath();
    ctx.moveTo(710, cHeight - 125);
    ctx.lineTo(450, cHeight - 125);
    ctx.lineWidth = 1;
    ctx.stroke();

    ctx.font = 'bold 20px sans-serif';
    ctx.textAlign = 'center';

    ctx.fillText('Conferimos a Fernando de Siqueira Porazzi o presente certificado por haver ministrado a ', xCenter, 383);
    ctx.fillText('palestra "XYZ" durante a TechParty 2016', xCenter, 410);
    ctx.fillText('promovida pela Faculdades Integradas de Taquara no dia XX/XX/XXXX.', xCenter, 437);

    ctx.font = '18px sans-serif';
    ctx.textAlign = 'center';
    ctx.fillText('Prof. Dr. Marcelo Azambuja', xCenter, cHeight - 100);

    ctx.font = '18px sans-serif';
    ctx.textAlign = 'center';
    ctx.fillText('Coordenador do Curso de Bacharelado em Sistemas de Informação', xCenter, cHeight - 70);

    ctx.font = '18px sans-serif';
    ctx.textAlign = 'center';
    ctx.fillText('Coordenador do Curso de Tecnólogo em Sistemas para Internet', xCenter, cHeight - 45);

    this.props.onFinished({encoded: canvas.toDataURL('image/png')})
  }

  render() {
    return (
      <canvas ref="canvas" width="1170" height="690"></canvas>
    );
  }
}